//实现 strStr() 函数。
//
//给定一个 haystack 字符串和一个 needle 字符串，在 haystack 字符串中找出 needle 字符串出现的第一个位置 (从0开始)。如果不存在，则返回  -1。
//
//示例 1:
//
//输入: haystack = "hello", needle = "ll"
//输出: 2
//示例 2:
//
//输入: haystack = "aaaaa", needle = "bba"
//输出: -1
//说明:
//
//当 needle 是空字符串时，我们应当返回什么值呢？这是一个在面试中很好的问题。
//
//对于本题而言，当 needle 是空字符串时我们应当返回 0 。这与C语言的 strstr() 以及 Java的 indexOf() 定义相符。

class Solution {
    func strStr(_ haystack: String, _ needle: String) -> Int {
        if needle.count <= 0 {
            return 0
        }
        if needle.count > haystack.count {
            return -1
        }
        
        for i in 0..<haystack.count-needle.count+1 {
            let startIndex = haystack.index(haystack.startIndex, offsetBy: i)
            let endIndex = haystack.index(haystack.startIndex, offsetBy: i+needle.count)
            
            if haystack[startIndex..<endIndex] == needle {
                return i
            }
        }
        
//        for i in 0..<haystack.count {
//            for j in 0...needle.count {
//                if j == needle.count {
//                    return i
//                }
//                if haystack[haystack.index(haystack.startIndex, offsetBy: i+j)] == needle[needle.index(needle.startIndex, offsetBy: j)] {
//                    if i+needle.count > haystack.count {
//                        return -1
//                    }
//                } else {
//                    break
//                }
//            }
//        }
        return -1
        
    }
}

